import React from 'react';

function PetInteraction() {
  const handlePetClick = () => {
    alert('The pets are dancing!');
  };

  return (
    <div className="container">
      <h2>Interactive Pets</h2>
      <img
        className="pet-image"
        src="/path/to/tobi.jpg"
        alt="Tobi"
        onClick={handlePetClick}
        style={{ width: '100px', margin: '10px', cursor: 'pointer', transition: 'transform 0.3s' }}
      />
      <img
        className="pet-image"
        src="/path/to/hachi.jpg"
        alt="Hachi"
        onClick={handlePetClick}
        style={{ width: '100px', margin: '10px', cursor: 'pointer', transition: 'transform 0.3s' }}
      />
    </div>
  );
}

export default PetInteraction;
